import React, { Component } from "react";
import "../../App.css";
import L from "leaflet";

var mymap = L.map("coronaMap").setView([51.505, -0.09], 13);

export class Map extends Component {
  render() {
    return <div id="coronaMap"></div>;
  }
}

export default Map;
